import React from 'react';
import './styles/app.css'

function Header(){
    return(
        <header className = 'header'> 
            <nav>
            <div> Ahmed Alamin </div>
            <ul>
                <li> Home </li>
                <li> About Me </li>
                <li> Portfolio </li>
                <li> Contact Me</li>
            </ul>
            </nav>
        </header>

    );
} 

export default Header;
